import React, {Component} from 'react'
import logoimg from '../img/logo.svg'
import 'bootstrap/dist/css/bootstrap.min.css'

class Logo extends Component {
    render() {
        return (
            <div className="row justify-content-end">
                <div className="col-xl-4" style={logoStyle}>
                    <a href="#" style={logoStyle}>Powered by: <img src={logoimg} alt='Visit Creator`s site' placeholder='jhjllk'/></a>
                </div>
            </div>
        )
    }
}
const logoStyle = {
    textDecoration: 'none',
    fontWeight: '600',
    fontSize: '1.3em',
    color: '#333',
}
const logoimgStyle = {
    width: '70%',
}
export default Logo
